import React ,{useEffect} from 'react'
// import { json } from 'react-router-dom'
import './Stylesheet/profile.css'
import { Link } from 'react-router-dom'

var profile_info="";
function Profile() {

    const email = localStorage.getItem('email')
      useEffect(() => {
        const email = localStorage.getItem('email')
        if (email) {

        }
    })

    const handlerChange = async (e) => {
        e.preventDefault()
        // const form = ({email})
        try {
            const response = await fetch("http://localhost:5000/getprofile", {
                method: "post",
                headers: {
                    "Content-Type": "application/json",
                },
                body: JSON.stringify({email})
            })

            if (response.ok) {
                const data = await response.json()
                profile_info=data.data
                console.log(profile_info.email)
            }
            else {
                const error = await response.json()
                alert(error.message)
                console.log(error)
            }

        } catch (error) {
            console.log(error)

        }
    }
    return (
        <>
            <div className="container-fluid  main-section">
                <div className="row">
                    <div className="col-md-12 mt-3 chaild-section">
                        <span>Home</span>
                        <span>/</span>
                        <span> My Account</span>
                    </div>
                </div>
            </div>
      {/* ....................profile section.............  */}
            <div className="container-fluid profile">
                <div className="row">
                    <div className="col-md-3 profile-section">
                        <div className='profile-heading'>
                            <h6> MY ACCOUNT </h6>
                            <h6>ACCOUNT DETAILS</h6>
                            <div className="row">
                                <div className="col-md-2 profile-account">
                                    <div className='user-icon'>
                                        <span><i className="fa fa-user"></i></span>
                                    </div>
                                </div> 
                                <div className="col-md-10 profile-account">
                                    <div className='user-detail'>
                                        <span onClick={handlerChange}>Jin Alkaid</span> 
                                         <span>{profile_info.email}</span>
                                    </div>
                                </div>
                            </div>
                            <p>Ung Van Khiem, Ho Chi Minh City, Vietnam</p>
                            <Link to="/add"><div className="btn btn-light">
                                MANAGER ADDRESS
                            </div>
                           </Link>
                        </div>
                    </div>
                {/* <div className="col-md-8 table-section">

                </div> */}
                </div>
            </div>
            {/* ....................profile section.............  */}
        </>
    )
}

export default Profile
